import React from 'react';
import { Route } from 'react-router';
import { BrowserRouter } from 'react-router-dom';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <Route>
      <App />
      </Route>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
